import { Route, Routes } from 'react-router';
import './App.css';
import AddExpense from './Components/AddExpense';
import Tracker from './Pages/Tracker';

function App() {




  return (
      <Routes>
        <Route path="/" exact element={<Tracker/>}/>
        <Route path="/add" element={<AddExpense/>}/>
        </Routes>
  );
}

export default App;
